import hashlib
print("Welcome to flag checker!")
print("What flag would you like to check?")
flag = input()
result = ""
for n in flag:
  n = ord(n)
  n += 10
  n -= 4
  n += 3
  n -= 7
  n = chr(n)
  n = hashlib.md5(n.encode())
  n = n.hexdigest()
  result += str(n)

if result == "":
  print("Thats the right flag!")
else:
  print("Sorry, that flag is wrong...")
